import React from "react";


function Card(props) {
    return (
        <>
            <div className="card">
                <div className="image">
                    <img src={props.images} alt="Images" />
                </div>
                <span>{props.title}</span>
                <div>{props.type}</div>
            </div>
        </>
    )
}
export default Card;
